import hashlib
import base64

base64str = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/="
x = ""
md5strings = [x[i:i + 32] for i in range(0, len(x), 32)]
print(md5strings)

b64 = ""
for md5string in  md5strings:
    for ch in base64str:
        if hashlib.md5(ch.encode('utf-8')).hexdigest() == md5string:
            b64 += ch

print(b64)
print(base64.b64decode(b64))
